def solve_string(s):
    n = len(s)
    if n == 0:
        return ""

    dp = [[] for _ in range(n + 1)]
    dp[0] = [""]

    for i in range(1, n + 1):
        for j in range(i):
            if dp[j] and s[j:i] in dp[j]:
                for tok in dp[j]:
                    dp[i].append(tok + " " + s[j:i])

    result = dp[n][0]
    return result

