def solve():
    s = "t10 t45 t17 t38 t40"

    try:

        result = analyze_grammar(s)
        print(result)

    except Exception as e:
        print(f"Error: {e}")

def analyze_grammar(grammar_string):

    grammar = {}

    current_state = ''

    for char in grammar_string:
        if char.isalpha():
            current_state += char
        elif char == ' ':
            if current_state:
                grammar[current_state] = ''
            else:
                current_state = ''
        else:
            current_state += char

    return grammar

